/*
Package tunnelproxymanager manages tunnel proxy server records.

Usage:
  -accesskeyid=: Change value of AccessKeyID.
  -autoscalingname=: Change value of AutoScalingName.
  -debug=false: Change value of Debug.
  -ebenvname=: Change value of EBEnvName.
  -hostedzone-callerreference=tunnelproxy_dev_2: Change value of HostedZone-CallerReference.
  -hostedzone-name=tunnelproxy.koding.com: Change value of HostedZone-Name.
  -region=: Change value of Region.
  -secretaccesskey=: Change value of SecretAccessKey.

With environment variables:
   CONFIG_ACCESSKEYID
   CONFIG_SECRETACCESSKEY
   CONFIG_REGION
   CONFIG_EBENVNAME
   CONFIG_AUTOSCALINGNAME
   CONFIG_HOSTEDZONE_NAME
   CONFIG_HOSTEDZONE_CALLERREFERENCE
   CONFIG_DEBUG

*/
package tunnelproxymanager
